/**
  Song.js
  @author Ethan Mil
  @version 1.0.0

  A React component that defines a song with the attributes of title (a string), artist (a string), year (an integer).
*/

import React from 'react';

const Song = ({ title, artist, year }) => {
  return (
    <div style={{ border: '1px solid #rbg', padding: '5px', marginBottom: '5px' }}>
      <h3>{title}</h3>
      <p style={{ fontWeight: 'bold' }}>Artist: {artist}</p>
      <p>Year: {year}</p>
    </div>
  );
};

export default Song;
